import "../wsp.css"

function Wsp() {
  return(
    <a href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola, Quisiera hacer unas consultas."  target="_blank" rel="noreferrer" class="float">
      <i class="fa fa-whatsapp my-float"></i>
    </a>
  )
}
export default Wsp;
